double sig(double a, double a1, double a2, double p){
	double No=(1.0-p)/(pow((a2/a1), 1.0-p)-1.0);
	return No*pow((a/a1), -p);
	// return a2;
}

double prec_tot(double a1, double a2, double p, double e0, double q, double e_test, double a_test, double omega_test, double b, int N, int flag){
	// Central body
    struct reb_particle star = {0};
    star.m = 1;
    //Number 
    int N0=100;
    int i=0;
    int j=0;
    struct reb_particle test;
    double deltaMM=2.0*Pi/N;
    double MM=1e-4+flag*deltaMM*0.5;
    double fx=0;
    double fy=0;
    double taux=0;
    double tauy=0;
    double tauz=0;
   	double edoty=0;
   	double edotx=0;
   	double edot=0;
   	double ex=e_test*cos(omega_test);
   	double ey=e_test*sin(omega_test);

    double jz=pow(a_test*(1.0-e_test*e_test), 0.5);
    double a=a1;
    double deltaA=(a2-a1)/N0;
    double e=e0;
    double f=0;

    for (j=0; j<N0; j++){

	    for (i=0; i<N; i++){
	    	f=reb_tools_M_to_f(e_test, MM);
	    	test=reb_tools_orbit2d_to_particle(1.0, star, 2.5e-7, a_test, e_test, omega_test, f);
	    	fx=force_x(a, e, test.x, test.y, test.z, b);
	    	fy=force_y(a, e, test.x, test.y, test.z, b);
	    	taux=torque_x(a, e, test.x, test.y, test.z, b);
	    	tauy=torque_y(a, e, test.x, test.y, test.z, b);
	    	tauz=torque_z(a, e, test.x, test.y, test.z, b);


	    	MM+=deltaMM;

	    	edotx=fy*jz+(test.vy*tauz-test.vz*tauy);
	    	edoty=-fx*jz-(test.vx*tauz-test.vz*taux);
	    	edot+=(ex*edoty-ey*edotx)/(e_test*e_test)*sig(a, a1, a2, p)*deltaA*deltaMM;
    	}
    a+=deltaA;
    e=pow((a/a1), q)*e0;
	}
	return edot;

}

